// Home.js

import React, { Component } from 'react';

export default class Home extends Component {
    render() {
        return (
            <div>
                <div className="container mt-10">
                    <div className="card">
                        <div className="card-header">
                            <label>Dashboard</label>

                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
